  <div className="col-7 text-right">Enter Loc:<input value={stu_location} id="stu_location" onChange={this.fn.bind(this)}/></div>
  </div>
  <div className="col-7 text-right"><button className="btn-primary" onClick={this.fnreg.bind(this)}>Register</button>
  </div>

  <div><Table students={students}  fnDelete={this.fnDelete}/></div>

